    //* ----------------------------------------------------------------------------------------------------
    //* Mise à jour de la date de synchronisation 
    //*
    //* Paramètres : base de données, la clé de recherche et la date du jour
    //* ----------------------------------------------------------------------------------------------------

    function MajDtSynchro(db, key){

        const date_jour = Date.now();

        //* Ouverture de la table : date_synchronisation
        const objectStore = db.transaction('date_synchronisation', 'readwrite')
                              .objectStore('date_synchronisation');

        //* Recherche de la clé. On est sur une seule enregistrement ( 1 par défaut )
        const request = objectStore.get(key);
    
        //* Enregistrement trouvé
        request.onsuccess = ()=> {
    
            //* Initialisation de l'objet synchro avec la date du jour
            let synchro = {
                id_synchro : 1,
                dt_synchro :  date_jour
            }

            // Mise à jour de l'enregostrement avec la clé en paramètre
            const updateRequest = objectStore.put(synchro, key);
    
            updateRequest.onsuccess = () => {
                console.log(`Mise à jour de la date de synchronsation ${updateRequest.result}`)
            }
            updateRequest.onerror = () => {
                console.log(`Erreur sur la mise à jour de la date de synchronsation`)
            }
        }
    }

