    async function getCategorieByNomCategorie(db, nom_categorie){
        return new Promise(function(resolve, reject){
            const txn = db.transaction('categorie', 'readonly');
            const store = txn.objectStore('categorie');
        
            // get the index from the Object Store
            const index = store.index('nom_categorie');
    
            // query by indexes
            let query = index.get(nom_categorie);

            // return the result object on success
            query.onsuccess = (event) => {
                 resolve(event.target.result);
            };
        
            query.onerror = (event) => {
                console.log('erreur');
                //reject(event.target.errorCode);
            }
    
            // close the database connection
            // txn.oncomplete = function () {
            // };

        });
    }

    //* ----------------------------------------------------------------------------------------------------
    //* Liste des catégories
    //*
    //* Paramètres : nom de la base de données  
    //* ----------------------------------------------------------------------------------------------------

    async function getAllCategorie(db) {
        return new Promise(function(resolve, reject){
        const txn = db.transaction('categorie', "readonly");
        const objectStore = txn.objectStore('categorie');
        liste = [];

        objectStore.openCursor().onsuccess = (event) => {
            let cursor = event.target.result;
            if (cursor) {
                let contact = cursor.value;
                //console.log(contact);
                liste.push(contact);
                // continue next record
                cursor.continue();
            } else {
                resolve(liste);
            }
        };

        // close the database connection
        // txn.oncomplete = function () {
        //    db.close();
        // };
        
        });
    };

